  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108234 includes chemical,
  meteorological, physical and underway - surface data collected from USCGC POLAR
  STAR in the Coral Sea, North Pacific Ocean, South Pacific Ocean and Tasman Sea from
  2001-11-02 to 2002-04-23 and retrieved during cruise 32PZ20011102. These data include
  BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE,
  Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE.
  The instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
  and Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.
  These data were collected by Rik Wanninkhof, Esa. Peltola and Kevin Sullivan of
  US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory as part
  of the VOS_Polar_Star_2001 data set.nnThe Global Volunteer Observing Ship (VOS)
  Program is coordinated by the UNESCO International Ocean Carbon Coordination Project
  (IOCCP). International groups from 14 countries have been outfitting research ships
  and commercial vessels with automated CO2 sampling equipment to analyze the carbon
  exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
